namespace JoF.Imparta.TaskList.Api.Domain.Repositories;

using JoF.Imparta.TaskList.Api.Domain.Exceptions;
using JoF.Imparta.TaskList.Api.Domain.Models;

public class ListTaskRepository : ITaskRepository
{
    private readonly IList<TaskItem> taskList = [];

    private readonly IList<ProfileItem> profileList = [];

    private readonly Guid zeroGuid = new("00000000-0000-0000-0000-000000000000");

    public ListTaskRepository(ILogger<ListTaskRepository> logger)
    {
        this.PopulateInitialData();
    }

    public Task<TaskItem> CreateAsync(TaskItem taskItem)
    {
        taskList.Add(taskItem);

        return Task.FromResult(taskItem);
    }

    public Task<ProfileItem> CreateAsync(ProfileItem profileItem)
    {
        profileList.Add(profileItem);

        return Task.FromResult(profileItem);
    }

    public Task<bool> DeleteAsync(Guid taskId)
    {
        var task = taskList.FirstOrDefault(t => t.Id.Equals(taskId));

        return task is null
            ? throw new TaskNotFoundException()
            : Task.FromResult(taskList.Remove(task));
    }

    public Task<IEnumerable<TaskItem>> GetAllByUserIdAsync(Guid userId)
    {
        var tasks = taskList
            .Where(t => t.UserId.Equals(userId));

        // return an example if there are none...
        return !tasks.Any()
            ? Task.FromResult(taskList
                .Where(t => t.UserId.Equals(this.zeroGuid)))
            : Task.FromResult(tasks
                .OrderByDescending(t => t.DateCreated)
                .Select(t => t));
    }

    public Task<TaskItem> GetById(Guid taskId)
    {
        var task = taskList.FirstOrDefault(t => t.Id.Equals(taskId));

        return task is null 
            ? throw new TaskNotFoundException() 
            : Task.FromResult(task);
    }

    public Task<ProfileItem> GetProfileImageAsync(Guid userId)
    {
        var profile = profileList.FirstOrDefault(p => p.UserId.Equals(userId));

        // return an example if none is set for this user
        return profile is null
            ? Task.FromResult(profileList.Where(p => p.UserId.Equals(this.zeroGuid)).First())
            : Task.FromResult(profile);
    }

    public Task<TaskItem> UpdateAsync(TaskItem taskItem)
    {
        var task = taskList.FirstOrDefault(t => t.Id.Equals(taskItem.Id)) ?? throw new TaskNotFoundException();

        task.Description = taskItem.Description;
        task.Status = taskItem.Status;
        task.Title = taskItem.Title;

        return Task.FromResult(task);
    }

    private void PopulateInitialData()
    {
        taskList.Add(new TaskItem
        {
            DateCreated = DateTime.UtcNow,
            Description = "Please create a new task, with a title and description.  This is a sample task - you cannot edit it or delete it, but you can play with its status!  It will be replaced when you create your own.  Remember also to update your profile image :)",
            Id = Guid.NewGuid(),
            Status = TaskStatus.Pending,
            Title = "Sample Task Title",
            UserId = this.zeroGuid
        });

        profileList.Add(new ProfileItem
        {
            ContentType = "image/png",
            ImageBase64 = "",
            UserId = this.zeroGuid
        });
    }
}
